import React from "react";
import { Link , Outlet} from 'react-router-dom';



const Projects = () => {


    return (
        <>
        <div className="projectpage">
        <div className="project_style">
        <ul>
            <li><Link  to= '/project/todolist'>Todolist</Link></li>
           <li> <Link  to='/project/acordion' >accordionproject</Link></li>
           <li><Link  to= '/project/search' >search</Link></li>
        </ul>
        </div>
        <Outlet />
        </div>
        </>

    )
}
export default Projects;
